import React from "react";
import { Button } from "@mui/material";

export default function NewGroupForm({ db }) {
  const addGroup = () => {
    try {
      db.add({
        name: "Test Group",
        count: [2, 3, 4, 1, 5, 6, 3, 3, 5],
        next: 4,
      })
        .then((resp) => {
          console.log(resp);
        })
        .catch((error) => {
          throw new Error(error.target.error);
        });
    } catch (error) {
      console.error(error);
    }
  };
  return <Button onClick={addGroup}>Add Group</Button>;
}
